
# 우, 하
dr = [0, 1]
dc = [1, 0]


T = int(input())

for t in range(1, T+1):

    field = []
    N = int(input())
    for n in range(N):
        field.append(list(map(int, input().split())))

    blocks = []
    for r in range(N):
        for c in range(N):

            if field[r][c] != 0:
                visited= []
                q = [[r, c]]
                while q:
                    pos = q.pop(0)
                    visited.append(pos)
                    field[pos[0]][pos[1]] = 0

                    for i in range(2):
                        target = [pos[0]+dr[i], pos[1]+dc[i]]

                        if not (0<=target[0]<N and 0<=target[1]<N):
                            continue
                        
                        if field[target[0]][target[1]] != 0 and target not in q:
                            q.append(target)

                lt, rb = visited[0], visited[-1]
                row, col = rb[0]-lt[0]+1, rb[1]-lt[1]+1

                blocks.append([row, col, row*col])

    blocks.sort(key=lambda x:(x[2], x[0])) #first key= row*col, seconod key= row size

    answer = str(len(blocks))
    for block in blocks:
        answer += ' '
        answer += ' '.join(map(str,block[:2]))

    print('#{} {}'.format(t, answer))




